import Layout from '../components/layout/Layout';
import { useRouter } from 'next/router';
import fetch from "isomorphic-unfetch";


export default function noticias(props) {
  const { noticias } = props;

  return (
    <div>
      <Menu />
      <h1 style={{ textAlign: "center" }}>
        Estamos en la página de películas.
      </h1>
      {movies.map((movie, index) => (
        <Link key={index} href="/movie/[movie]" as={`/movie/${movie.id}`}>
          <a style={{ marginRight: 20 }}>{movie.name}</a>
        </Link>
      ))}
    </div>
  );
}



noticias.getInitialProps = async () => {
  const res = await fetch("https://api-test-ln.herokuapp.com/articles");
  const noticias = await res.json();

  return { noticias };
};


